import React, {Component} from 'react';
import './App.css';
import TodoItem from './components/TodoItem';

class App extends Component {
  constructor() {
    super();    
    this.todoItems = [
      "Mua bim bim",
      "Đi đá bóng",
      "Đọc sách",
      "I love you"
    ];
  }
  render () {  
  return (
    <div className="App">    

      {
        this.todoItems.map((item) => <TodoItem  title={item}/>)
      }


    </div>
  );
  }
}

export default App;
